import React, { Component } from "react";
import { auth } from "../config";

export default class Test extends Component {
  state = {
    email: "",
    password: "",
    stuname: "",
    stunum: "",
    cid: "",
    croom: "",
    nroom: "",
  };

  handleChange = (e) => {
    const { name, value } = e.target;

    this.setState({ [name]: value });
  };

  handleSubmit = async (e) => {
    e.preventDefault();
    const { email, password } = this.state;
    try {
      const { students } = await auth.createUserWithEmailAndPassword(
        email,
        password
      );
      console.log(students);
      createUserDocument(students)
    } catch (error) {
      console.log("errer", error);
    }

    this.setState({
      email: "",
      password: "",
      stuname: "",
      stunum: "",
      cid: "",
      croom: "",
      nroom: "",
    });
  };
  render() {
    const { email, password, stuname, stunum, cid, croom, nroom } = this.state;
    return (
      <div>
        <form className="signup" onSubmit={this.handleSubmit}>
          <input
            type="email"
            name="email"
            value={email}
            onChange={this.handleSubmit}
            placeholder="email"
          />
          <input
            type="password"
            name="password"
            value={password}
            onChange={this.handleSubmit}
            placeholder="pass"
          />
          <input
            type="name"
            name="stuname"
            value={stuname}
            onChange={this.handleSubmit}
            placeholder="name"
          />
          <input
            type="text"
            name="stunum"
            value={stunum}
            onChange={this.handleSubmit}
            placeholder="number"
          />
          <input
            type="text"
            name="classid"
            value={cid}
            onChange={this.handleSubmit}
            placeholder="idclass"
          />
          <input
            type="text"
            name="croom"
            value={croom}
            onChange={this.handleSubmit}
            placeholder="class"
          />
          <input
            type="text"
            name="nroom"
            value={nroom}
            onChange={this.handleSubmit}
            placeholder="room"
          />
          <button>upload</button>
        </form>
      </div>
    );
  }
}
